.github-StubItem-git-tab-controller {
  flex: 1;
  display: flex;
}
.github-Panel {
  flex: 1;
  display: flex;
  flex-direction: column;
  min-width: 0;
  font-family: 'Roboto', 'Lucida Grande', 'Segoe UI', Ubuntu, Cantarell, sans-serif;
  font-size: 12px;
  color: rgba(183, 197, 211, 0.65);
  -webkit-user-select: none;
  cursor: default;
}
.github-Panel.no-repository {
  padding: 30px;
  text-align: center;
}
.github-Panel.is-loading {
  color: rgba(183, 197, 211, 0.35);
}
.github-Panel.no-repository {
  display: flex;
  justify-content: center;
  font-size: 1.25em;
}
.github-Panel.no-repository > * {
  margin: 10px 0;
}
.github-Panel.no-repository .git-logo-path {
  fill: rgba(60, 69, 77, 0.881);
}
.github-Panel.no-repository .btn.btn-primary {
  overflow: hidden;
  text-overflow: ellipsis;
}
atom-dock.bottom .github-Panel {
  flex-direction: row;
}
atom-dock.bottom .github-StagingView {
  display: contents;
}
atom-dock.bottom .github-Panel > div {
  flex: 1;
}
atom-dock.bottom .github-StagedChanges {
  border-left: 1px solid transparent;
  border-right: 1px solid transparent;
}
atom-dock.bottom .github-StagingView-header {
  flex-wrap: wrap;
}
atom-dock.bottom .github-StagingView-group:first-child .github-StagingView-header {
  border-top: 1px solid transparent;
}
atom-dock.bottom .github-RecentCommits {
  max-height: none;
  border-left: 1px solid transparent;
}
